import React from 'react';
// import React, { useState, useEffect } from 'react';
import BlogData from './data.json';
import { NavLink } from 'react-router-dom';

function Rel(props) {
  const post = BlogData.data;

  return (
    <div>
      {post.map((post) => {
        return (
          <NavLink to={`/post/${post.id}`}>
            <div>
              <h1>{post.blogTitle}</h1>
              <p>{post.postedOn}</p>
            </div>
          </NavLink>
        );
      })}
    </div>
  );
}

export default Rel;
